import { Box, Slide, withStyles } from "@material-ui/core";
import IQuestion from "../../../../Models/IQuestion";

interface IProps {
  question: IQuestion;
}

export default function CurrentQuestion({ question }: IProps) {
  return (
    <Slide in={true} direction="left">
      <Container>{question?.question}</Container>
    </Slide>
  );
}

const Container = withStyles({
  root: {
    padding: "0.5rem 1rem",
  },
})(Box);
